const handleSubmit = (event) => {
  event.preventDefault()

  const {
    REACT_APP_EMAILJS_RECEIVER: receiverEmail,
    REACT_APP_EMAILJS_TEMPLATEID: template
  } = this.props.env

  this.sendFeedback(
    template,
    this.props.senderEmail,
    receiverEmail,
    this.state.feedback)

  this.setState({
    formSubmitted: true
  })
}

export default handleSubmit;
